"Camerata DB meets web 2.0 - the data-base operations can be accessed\nthrough the respective navigation buttons at the top of the page. The\npage below may be used as a bulletin-board. Configuration options are\naccessible through the gear- and pencil-shaped buttons in the\nbottom-left and top-right edge of the screen" => "Camerata DB @ web 2.0 - die eigentlichen Datenbanken-Operationen erreicht man über die Navigatíonsleiste oben. Die aktuelle Seite kann man als eine Art Pinnwand benutzen. Einstellungen lassen sich über die zahnrad- und stiftförmigen Knöpfe links-unten und rechts-oben vornehmen.",
"New note" => "Neue Notiz",
"Avatar pictures can be uploaded through the contacts-application by\nadding a photo to a contact-card which has the users login-name as\nnick-name." => "Avatar-Bilder können in der Adressbuch-Applikation hinzugefügt werden,\nin dem ein Adressbuch-Eintrag mit dem Login-Namen als Spitznamen\nangelegt wird. Dort kann dann ein Bild zugewiesen werden.",
